import { Link } from 'react-router-dom';
import './Navbar.css';

export default function Navbar() {
    return (
        <nav>
            <div className="leftSide">
                <h3 className="navBrand">Multi<span>Coder</span></h3>
                <Link to="/">Home</Link>
                <Link to="/">About</Link>
                <Link to="/">Play</Link>
            </div>
            <div className="rightSide"></div>
        </nav>
    )
}
